import Image from './Image'
import useFetch from './useFetch';
import apiKey from '../config';

let api = apiKey;

const Home = () => {

  const { data: photos, isPending, error } = useFetch(`https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=${api}&tags=elvis&per_page=24&format=json&nojsoncallback=1`)

  return ( 
    <div className="photo-container">
      <h2>Results</h2>
      { error && <div>{ error }</div> }
      { isPending && <div>Loading...</div> }
        <ul>
          <Image image={photos} />
        </ul>
  </div>
   );
}

export default Home;
